import React, { Component } from 'react'
import axios from 'axios'

export default class ReatApi extends Component {

     //Mounting for state_Calls
    constructor(props) 
    {
        super(props)
    
        this.state = 
        { 
            title:'Constructor Method by State Object',
            users:[],
        }


    }


    

    //Mounting for RESTAPI_Calls
    componentDidMount()
    {
        axios
        .get('https://jsonplaceholder.typicode.com/users')
        .then( 
                (result)=>this.setState({ users:result.data  })  
            )   
    }
    

     //Mounting for Output Preparation
    render() {
        return (<>
            <div className="container p-5">
                
                <h1> Users RESTAPI Data </h1>
                
              

                    {
                        
                        this.state.users.map( (res,index)=>
                        {
                            return(<ul key={index}>
                                    <li>{res.id}</li>
                                    <li>{res.name}</li>
                                    <li>{res.email}</li>
                            </ul>)
                        })
                    }


            </div>
        </>)
    }


}
